import "./Stage5.css";
const Stage5 = () => {
  const [wrong, setWrong] = useState(false);
  return (
    <div id="stage5Div">
      <h1>Welcome to the last round of the treasure hunt!!!</h1>
      <p>You have already got everything you need to get the treasure.</p>

      <p>
        Name that island where BlackBeard hid his treasure and the Treasure is
        yours.
      </p>

      <input className="answerInput" type="text"></input>
      <button className="piratebtn default">Check</button>
      {wrong && <p id="wrongAnswer">Oops !! wrong answer.</p>}
      <hr id="line" />
      <p id="hint">Hint : Find the source of this page.</p>
    </div>
  );
};

export default Stage5;
